import React from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from './Sidebar';
import { Table } from 'antd';
import {data} from '../JSON data/userschart';
import '../dashboard.css';

const Custodians = () => {
const navigate = useNavigate(); 


  const handleLogout = (e) => {
    e.preventDefault();

    console.log('Logging out');
    navigate('/login');
  };

  const columns = [
    {
    title: 'ID',
    dataIndex: 'id',
    key: 'id',
},

{
    title: 'NAME',
    dataIndex: 'name',
    key: 'name',
},
{
    title: 'ASSET_TYPE',
    dataIndex: 'asset_type',
    key: 'asset_type',
},
{
    title: 'SERIAL_NO',
    dataIndex: 'serial_no',
    key: 'serial_no',
},
{
    title: 'OS',
    dataIndex: 'os',
    key: 'os',
},
{
    title: 'MODEL',
    dataIndex: 'model',
    key: 'model',
},
{
    title: 'VENDOR',
    dataIndex: 'vendor',
    key: 'vendor',
},
{
    title: 'SOFTWARE',
    dataIndex: 'software',
    key: 'software',
},
{
    title: 'DATE',
    dataIndex: 'date',
    key: 'date',
},
];

  return (

    <div className="dashboard_wrapper">
    <Sidebar/>

          <div className="Header">
          <button className="topnav-right" onClick={handleLogout}>Out</button>
              <h2 className="dashboard-h2">Custodians</h2>
             </div>

                <div className="dashboardpage">
                  <h1>Welcome to the Custodians Page</h1>
                  <p>Here is your main content.</p>
                </div>

                <Table className="assetbox"
                    dataSource={data}
                    columns={columns}
                    rowKey="id"
                    pagination={{ pageSize: 4 }}
                />
     </div>


  );
};


export default Custodians;
